class Solution {
    /**
    Input to this function is a string represented multiple groups for nested parentheses separated by spaces.
    For each of the group, output the deepest level of nesting of parentheses.
    E.g. (()()) has maximum two levels of nesting while ((())) has three.

    >>> parse_nested_parens("(()()) ((())) () ((())()())")
    [2, 3, 1, 3]
     */
    public List<Integer> parse_nested_parens(String paren_string) {
        String[] groups = paren_string.split(" ");
        List<Integer> result = new ArrayList<>();

        for (String group : groups) {
            if (!group.isEmpty()) {
                int depth = 0;
                int maxDepth = 0;
                for (char c : group.toCharArray()) {
                    if (c == '(') {
                        depth++;
                        maxDepth = Math.max(depth, maxDepth);
                    } else if (c == ')') {
                        depth--;
                    }
                }
                result.add(maxDepth);
            }
        }
        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.parse_nested_parens("(()()) ((())) () ((())()())").equals(Arrays.asList(2, 3, 1, 3)),
                s.parse_nested_parens("() (()) ((())) (((())))").equals(Arrays.asList(1, 2, 3, 4)),
                s.parse_nested_parens("(()(())((())))").equals(Arrays.asList(4))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

