class Solution {
    /**
    Input to this function is a string representing musical notes in a special ASCII format.
    Your task is to parse this string and return list of integers corresponding to how many beats does each
    not last.

    Here is a legend:
    "o" - whole note, lasts four beats
    "o|" - half note, lasts two beats
    ".|" - quater note, lasts one beat

    >>> parse_music("o o| .| o| o| .| .| .| .| o o")
    [4, 2, 1, 2, 2, 1, 1, 1, 1, 4, 4]
     */
    public List<Integer> parse_music(String string) {
        Map<String, Integer> noteMap = new HashMap<>();
        noteMap.put("o", 4);
        noteMap.put("o|", 2);
        noteMap.put(".|", 1);

        String[] notes = string.split(" ");
        List<Integer> durations = new ArrayList<>();

        for (String note : notes) {
            if (!note.isEmpty()) {
                durations.add(noteMap.get(note));
            }
        }

        return durations;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.parse_music("").equals(List.of()),
                s.parse_music("o o o o").equals(Arrays.asList(4, 4, 4, 4)),
                s.parse_music(".| .| .| .|").equals(Arrays.asList(1, 1, 1, 1)),
                s.parse_music("o| o| .| .| o o o o").equals(Arrays.asList(2, 2, 1, 1, 4, 4, 4, 4)),
                s.parse_music("o| .| o| .| o o| o o|").equals(Arrays.asList(2, 1, 2, 1, 4, 2, 4, 2))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
