class Solution {
    /**
    Return true if a given number is prime, and false otherwise.
    >>> is_prime(6)
    false
    >>> is_prime(101)
    true
    >>> is_prime(11)
    true
    >>> is_prime(13441)
    true
    >>> is_prime(61)
    true
    >>> is_prime(4)
    false
    >>> is_prime(1)
    false
     */
    public boolean is_prime(int n) {
        if (n < 2) {
            return false;
        }
        for (int k = 2; k <= Math.sqrt(n); k++) {
            if (n % k == 0) {
                return false;
            }
        }
        return true;
    }
}

