class Solution {
    /**
    Return the number of times the digit 7 appears in integers less than n which are divisible by 11 or 13.
    >>> fizz_buzz(50)
    0
    >>> fizz_buzz(78)
    2
    >>> fizz_buzz(79)
    3
     */
    public int fizz_buzz(int n) {
        int count = 0;
        for (int i = 0; i < n; i++) {
            if (i % 11 == 0 || i % 13 == 0) {
                String str = String.valueOf(i);
                for (char c : str.toCharArray()) {
                    if (c == '7') {
                        count++;
                    }
                }
            }
        }
        return count;
    }
}

