class Solution {
    /**
    prime_fib returns n-th number that is a Fibonacci number and it's also prime.
    >>> prime_fib(1)
    2
    >>> prime_fib(2)
    3
    >>> prime_fib(3)
    5
    >>> prime_fib(4)
    13
    >>> prime_fib(5)
    89
     */
    public int prime_fib(int n) {
        int count = 0;
        int a = 0;
        int b = 1;
        while (true) {
            int temp = a;
            a = b;
            b = temp + b;
            if (isPrime(b)) {
                count++;
                if (count == n) {
                    return b;
                }
            }
        }
    }

    public boolean isPrime(int num) {
        if (num < 2) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(num); i++) {
            if (num % i == 0) {
                return false;
            }
        }
        return true;
    }
}

