class Solution {
    /**
    triples_sum_to_zero takes a list of integers as an input.
    it returns True if there are three distinct elements in the list that
    sum to zero, and False otherwise.

    >>> triples_sum_to_zero(Arrays.asList(1, 3, 5, 0))
    false
    >>> triples_sum_to_zero(Arrays.asList(1, 3, -2, 1))
    true
    >>> triples_sum_to_zero(Arrays.asList(1, 2, 3, 7))
    false
    >>> triples_sum_to_zero(Arrays.asList(2, 4, -5, 3, 9, 7))
    true
    >>> triples_sum_to_zero(Arrays.asList(1))
    false
     */
    public boolean triples_sum_to_zero(List<Integer> l) {
        int[] arr = new int[l.size()];
        for (int i = 0; i < l.size(); i++) {
            arr[i] = l.get(i);
        }
        Arrays.sort(arr);
        for (int i = 0; i < arr.length - 2; i++) {
            int left = i + 1;
            int right = arr.length - 1;
            while (left < right) {
                int total = arr[i] + arr[left] + arr[right];
                if (total < 0) {
                    left++;
                } else if (total > 0) {
                    right--;
                } else {
                    return true;
                }
            }
        }
        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, 5, 0))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, 5, -1))),
                s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, -2, 1))),
