class Solution {
    /**
    Return 2^n modulo p (be aware of numerics).
    >>> modp(3, 5)
    3
    >>> modp(1101, 101)
    2
    >>> modp(0, 101)
    1
    >>> modp(3, 11)
    8
    >>> modp(100, 101)
    1
     */
    public int modp(int n, int p) {
        int ret = 1;
        int base = 2;
        while (n > 0) {
            if (n % 2 == 1) {
                ret = (ret * base) % p;
            }
            base = (base * base) % p;
            n = n / 2;
        }
        return ret;
    }
}

