class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        int sum = 0;
        for (int num : q) {
            sum += num;
        }
        if (sum > w) {
            return false;
        }

        int i = 0, j = q.size() - 1;
        while (i < j) {
            if (!q.get(i).equals(q.get(j))) {
                return false;
            }
            i++;
            j--;
        }
        return true;
    }
}

public class Main {
