class Solution {
    public List<Integer> even_odd_palindrome(int n) {
        int evenPalindromeCount = 0;
        int oddPalindromeCount = 0;

        for (int i = 1; i <= n; i++) {
            if (isPalindrome(i)) {
                if (i % 2 == 0) {
                    evenPalindromeCount++;
                } else {
                    oddPalindromeCount++;
                }
            }
        }

        List<Integer> result = new ArrayList<>();
        result.add(evenPalindromeCount);
        result.add(oddPalindromeCount);
        return result;
    }

    private boolean isPalindrome(int num) {
        String str = String.valueOf(num);
        int left = 0;
        int right = str.length() - 1;

        while (left < right) {
            if (str.charAt(left) != str.charAt(right)) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }
}

