class Solution {
    public boolean move_one_ball(List<Integer> arr) {
        if (arr.isEmpty()) {
            return true;
        }
        List<Integer> sortedArray = new ArrayList<>(arr);
        Collections.sort(sortedArray);
        int minValue = Collections.min(arr);
        int minIndex = arr.indexOf(minValue);
        List<Integer> shiftedArray = new ArrayList<>();
        shiftedArray.addAll(arr.subList(minIndex, arr.size()));
        shiftedArray.addAll(arr.subList(0, minIndex));
        return shiftedArray.equals(sortedArray);
    }
}

