class Solution {
    /**
    You are given an array arr of integers and you need to return
    sum of magnitudes of integers multiplied by product of all signs
    of each number in the array, represented by 1, -1 or 0.
    Note: return None for empty arr.

    Example:
    >>> prod_signs(Arrays.asList(1, 2, 2, -4)) == -9
    >>> prod_signs(Arrays.asList(0, 1)) == 0
    >>> prod_signs(Arrays.asList()) == None
     */
    public Optional<Integer> prod_signs(List<Integer> arr) {
        if (arr.isEmpty()) return Optional.empty();
        int sumOfMagnitudes = 0;
        int negativeCount = 0;
        boolean hasZero = false;
        for (int num : arr) {
            sumOfMagnitudes += Math.abs(num);
            if (num < 0) negativeCount++;
            if (num == 0) hasZero = true;
        }
        int productOfSigns = hasZero ? 0 : (negativeCount % 2 == 0) ? 1 : -1;
        return Optional.of(sumOfMagnitudes * productOfSigns);
    }
}

