class Solution {
    /**
    Create a function that takes a string as input which contains only square brackets.
    The function should return true if and only if there is a valid subsequence of brackets
    where at least one bracket in the subsequence is nested.

    is_nested("[[]]") -> true
    is_nested("[]]]]]]][[[[[]") -> false
    is_nested("[][]") -> false
    is_nested("[]") -> false
    is_nested("[[][]]") -> true
    is_nested("[[]][[") -> true
     */
    public boolean is_nested(String string) {
        int[] openingBracketIndex = new int[string.length()];
        int[] closingBracketIndex = new int[string.length()];
        int openingCount = 0;
        int closingCount = 0;
        for (int i = 0; i < string.length(); i++) {
            if (string.charAt(i) == '[') {
                openingBracketIndex[openingCount++] = i;
            } else {
                closingBracketIndex[closingCount++] = i;
            }
        }
        int j = closingCount - 1;
        int count = 0;
        for (int i = 0; i < openingCount; i++) {
            if (j >= 0 && openingBracketIndex[i] < closingBracketIndex[j]) {
                count++;
                j--;
            }
        }
        return count >= 2;
    }
}

