        List<Integer> myTri = new ArrayList<>();
        if (n == 0) {
            myTri.add(1);
            return myTri;
        }
        myTri.add(1);
        myTri.add(1);
        myTri.add(3);
        for (int i = 4; i <= n + 1; i++) {
