    public boolean check_if_last_char_is_a_letter(String txt) {
        String[] words = txt.split(" ");
        if (words.length == 0 || words[words.length - 1].length() != 1) {
            return false;
        }
        char lastChar = words[words.length - 1].charAt(0);
        return (lastChar >= 'a' && lastChar <= 'z') || (lastChar >= 'A' && lastChar <= 'Z');
    }
}

