class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        int val = n * n + 1;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid.get(i).get(j) == 1) {
                    if (i > 0 && grid.get(i - 1).get(j) < val) {
                        val = grid.get(i - 1).get(j);
                    }
                    if (j > 0 && grid.get(i).get(j - 1) < val) {
                        val = grid.get(i).get(j - 1);
                    }
                    if (i < n - 1 && grid.get(i + 1).get(j) < val) {
                        val = grid.get(i + 1).get(j);
                    }
                    if (j < n - 1 && grid.get(i).get(j + 1) < val) {
                        val = grid.get(i).get(j + 1);
                    }
                }
            }
        }

        List<Integer> ans = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            if (i % 2 == 0) {
                ans.add(1);
            } else {
                ans.add(val);
            }
        }
        return ans;
    }
}

