class Solution {
    public List<Optional<Integer>> largest_smallest_integers(List<Integer> lst) {
        int maxNegative = Integer.MIN_VALUE;
        int minPositive = Integer.MAX_VALUE;
        boolean hasNegative = false;
        boolean hasPositive = false;

        for (int num : lst) {
            if (num < 0) {
                hasNegative = true;
                maxNegative = Math.max(maxNegative, num);
            } else if (num > 0) {
                hasPositive = true;
                minPositive = Math.min(minPositive, num);
            }
        }

        List<Optional<Integer>> result = new ArrayList<>();
        result.add(hasNegative ? Optional.of(maxNegative) : Optional.empty());
        result.add(hasPositive ? Optional.of(minPositive) : Optional.empty());

        return result;
    }
}

