class Solution {
    public List<String> bf(String planet1, String planet2) {
        String[] planetNames = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};
        List<String> result = new ArrayList<>();

        int index1 = Arrays.asList(planetNames).indexOf(planet1);
        int index2 = Arrays.asList(planetNames).indexOf(planet2);

        if (index1 == -1 || index2 == -1 || index1 == index2) {
            return result;
        }

        int start = Math.min(index1, index2) + 1;
        int end = Math.max(index1, index2);

        for (int i = start; i < end; i++) {
            result.add(planetNames[i]);
        }

        return result;
    }
}

