    public int specialFilter(List<Integer> nums) {
        int count = 0;
        for (Integer num : nums) {
            if (num > 10) {
                String numberAsString = String.valueOf(Math.abs(num));
                if (isOdd(numberAsString.charAt(0)) && isOdd(numberAsString.charAt(numberAsString.length() - 1))) {
                    count++;
                }
            }
        }
        return count;
    }

    private boolean isOdd(char digit) {
        return digit == '1' || digit == '3' || digit == '5' || digit == '7' || digit == '9';
    }
