class Solution {
    public String Strongest_Extension(String class_name, List<String> extensions) {
        String strong = extensions.get(0);
        int my_val = getStrength(strong);
        for (String s : extensions) {
            int val = getStrength(s);
            if (val > my_val) {
                strong = s;
                my_val = val;
            }
        }
        return class_name + "." + strong;
    }

    private int getStrength(String extension) {
        int cap = 0;
        int sm = 0;
        for (char c : extension.toCharArray()) {
            if (Character.isUpperCase(c)) {
                cap++;
            } else if (Character.isLowerCase(c)) {
                sm++;
            }
        }
        return cap - sm;
    }
}

